import './ListLivres.css';

function ListLivres() {
  return (
    <>
      {
        props2.books.map((element) => (
          <div>
            <h1></h1>
            <p>nb tomes</p>
            <p></p>
          </div>
        ))
      }
      <div className='Livre'>
          <h1>One piece</h1>
          <p>103 tomes</p>
          <p>Nous sommes à l'ère des pirates. Luffy, un garçon espiègle, rêve de devenir le roi des pirates en trouvant le "One Piece", un fabuleux trésor. Par mégarde, Luffy a avalé un jour un fruit démoniaque qui l'a transformé en homme caoutchouc. Depuis, il est capable de contorsionner son corps élastique dans tous les sens, mais il a perdu la faculté de nager. Avec l'aide de ses précieux amis, dont le fidèle Shanks, il va devoir affronter de redoutables pirates dans des aventures toujours plus rocambolesques.</p>
      </div>
      <div className='Livre'>
          <h1>20th century Boys</h1>
          <p>11 tomes</p>
          <p>Kenji est un commerçant lambda qui a repris le magasin familial. La police vient un jour l'interroger sur la disparition de la famille de l'un de ses clients. Le seul indice est un mystérieux symbole dessiné à côté d'une porte. Kenji ne se sent pas particulièrement concerné, jusqu'au jour où Donkey, un ami d'enfance, lui demande s'il se souvient de ce symbole. Kenji explore alors la vie de Donkey, son passé et celui du groupe d'amis dont il faisait partie dans sa jeunesse. Il découvre bientôt l'existence d'une organisation clandestine que dirige l'énigmatique Ami et qui utilise le symbole lié au passé de Kenji comme signe de ralliement.</p>
      </div>
      <div className='Livre'>
          <h1>Fairy Tail</h1>
          <p>63 tomes</p>
          <p>Les guildes magiques sont des associations. Elles proposent différentes tâches aux magiciens, allant de la recherche d’un objet à l’attaque en règle. Lucy, une jeune fille, rêve de devenir magicienne. Un jour, elle rencontre Natsu, un magicien maîtrisant le feu, ce dernier l’invite alors à rejoindre sa guilde. Il s’agit de la célèbre Fairy Tail, le sujet de tous les rêves de Lucy. Mais celle-ci est bien mystérieuse et semble être à l’origine de nombreux scandales.</p>
      </div>
    </>
  );
}

export default ListLivres;
